INSERT INTO `index_brief_introduction` VALUES (3,'2021-05-02','桂平西山旅游风景区','<p>&nbsp; &nbsp; &nbsp; &nbsp; 桂平西山是我国著名的七大西山之一，又称思灵山(思陵山)。因在桂平市城西1公里而得名。从南梁王朝设桂平郡治于西山大窝棚起，渐成为游览胜地。俗有&ldquo;桂林山水甲天下，更有浔城半边山&rdquo;之称。山上古树参天，清泉甘洌，怪石嶙峋，石径曲幽。以西山为中心，其周围35公里内有全国重点文物保护单位金田起义遗址、龙潭国家森林公园和由大藤峡、白石洞天、罗丛福地、紫荆瑶山、浔州古城秀京、北回归线标志塔、东塔等组成的风景名胜群，&ldquo;夙擅名胜&rdquo;，&ldquo;别有天地&rdquo;，为&ldquo;南天第一秀山&rdquo;。西山素以&ldquo;林秀、石奇、泉甘、茶香、佛圣&rdquo;著称。佳期木交荫，石洞通灵，清泉喷乳，仙茗凝香，名庵古寺高僧驻锡。西山下黔江郁水交江浔江，东塔回澜。浔州古城是古代大成国国都秀京，保存着王府遗址和宋代古窑址、汉墓、新石器时代遗址等名胜古迹。北回归线标志塔、东塔、郁江枢纽工程就在大江岸3公里内。白石洞天，是全国&ldquo;三十六洞天&rdquo;中的&ldquo;二十一洞天&rdquo;，为典型的丹霞地貌，石峰险绝，山下是著名的麻垌荔乡。</p>','100/人',' 04:00-19:00');
